/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<li tabindex="${ifDefined(context._tabIndex)}" class="ui5-ghli-root ${classMap(context.classes.main)}" @focusin="${context._onfocusin}" @focusout="${context._onfocusout}" @keydown="${context._onkeydown}" role="option" style="list-style-type: none;"><span class="ui5-hidden-text">${ifDefined(context.groupHeaderText)}${ifDefined(context.accessibleName)}</span><div id="${ifDefined(context._id)}-content" class="ui5-li-content"><span class="ui5-ghli-title"><slot></slot></span></div></li>`; };


	return block0(context);
};

export default main;
